	["Дневник миссис Далсон"] = {
		["В дневнике с пожелтевшими от времени страницами открыта последняя запись:$B$B'Гарольд превратился в нежить, и я не знаю, что теперь будет. Я из последних сил утащила его в единственное место, которое можно надежно запереть. Я держу ключ при себе, будем надеяться, что моя уловка сработает…$b$bНадеюсь, я смогу выбраться отсюда, но для этого нужны деньги. Все наши вещи в шкафу… и, кажется, Гарольд держал ключ от него при себе.$b$bПора мне отдохнуть, я смертельно устала.'"] = "717e4452946d86f15f58fb9bae10c1b8",
