	["Каталог Малифоя"] = {
		["Землю, на которой был выстроен Некроситет, Кел'Тузад получил от семейства Баровых. За эту землю – место, где приверженцы Культа Проклятых могли изучать мерзкую магию Плети, – Кел'Тузад даровал Барову бессмертие посредством превращения в нежить.$B$BВ Склепе Теней можно найти шкуру Тени и ее хозяйку, леди Иллюсию Бароу.$B$BНаилучшее зеркало тщеславия и тлена смерти."] = "33f4d18ce0ab409c37b0395f421b1056",
		["Изготовлено братством Тория.$B$BКристаллы арканита добываются на ториевых месторождениях. Для их преобразования в арканитовые слитки нужны глубокие познания в алхимии.$B$BНайди специалиста по горному делу, если ты $gсам:сама; в нем не разбираешься… и хорошего алхимика! Тебе понадобятся оба."] = "d46d54093f1260912aed6c305f8d3ca6",
		["Лучшее средство для сохранение плоти, известное как людям, так и Плети, это бальзамировочный состав Ледяного Шепота. Есть только одно место, где можно его добыть… И едва ли тот, чьим именем назван состав, отнесется с пониманием к незваному гостю.$B$BНо… если тебе нужна эта жидкость, отправляйся в Некроситет…"] = "bc097c6ccf37ea8c37e08bf804253ff4",
		["Последнее прибежище безумных фанатиков. Там они вышивают свои алые одежды заколдованными нитями!$B$BСтупай в Стратхольм, $Gпутник:путница;!"] = "a1ab5bb20b1a4b85596ee4b43ec71cb8",
		["Если вам нужна истлевшая шовная нить поганища, то вам прямая дорога в Стратхольм.$B$BРаньше в этом городе жил сам Светоносец, а теперь там полно приспешников Кел'Тузада.$B$BВойдите в горящий город и убейте столько жирных поганищ, сколько сможете! И будут вам шовные нити!"] = "3f424f4d79a0f2e7f08530b667b2e442",
