	["Записи Ракмора"] = {
		["После нападения макруры мы поняли, что следующего нападения 'Доблесть' не выдержит. Поэтому я с несколькими уцелевшими моряками покинул корабль.$B$BИ вот мы на суше. Собираемся отправиться к Высоте Найджела. На пути туда нас ждет множество опасностей, и я боюсь, что мы сгинем в Пустошах.$B$BЯ пишу эти строки в надежде, что кто-нибудь проникнется нашей бедой и отомстит водным тварям, погубившим нас."] = "b7584554dd225ef7e529ef1bd508f29b",
		["Сундук мой устроен весьма хитро; чтобы его открыть, нужны два ключа, золотой и серебряный. Первый, серебряный ключ я отдал своему первому помощнику, а золотой оставил себе.$B$BНо нам было суждено потерять их. Мой ключ был утрачен при очередной атаке наг, а ключ первого помощника- на день позже, когда нас атаковал Сухохват-макрура и утянул его с собой в пучину.$B$BЯ уверен, что ключи у наг и макрура. Я рад, что они враги и не станут делиться друг с другом."] = "4737220be29ed0b0905a27df23942c8f",
		["'Я – Улисс Ракмор, капитан 'Доблести'. А это судовой журнал моего несчастного корабля. $B$BМы шли в Крепость Оперенной Луны с грузом припасов, когда на нас напали наги. Мы отбили атаку, но были уверены, что противник вернется с новыми силами. Боясь потерять свое самое ценное имущество, я направил 'Доблесть' к острову у берегов Пустошей, на котором есть древние руины ночных эльфов. Там я и спрятал сундук с сокровищами'."] = "c59de48f730da3b5d7c895e1e6639450"
	},
